        G_val = int(G, 16)
        B_val = int(B, 16)
        if B_val < G_val and B_val < R_val:
            sorted_values = sorted([R, G, B])
            color = f'#{sorted_values[0]}{sorted_values[2]}{sorted_values[1]}'
    return yellow_to_green.get(color.lower(), color)

